body {

  position: relative;

.wrapper-map {

.info,
.colors {

  padding: 10px;

  background-color: white;

.info {

  left: 0;

.info td:first-child {
  font-weight: bold;
  width: 85px;

.colors {

.colors h1 {

  margin: 0;
}

.colors ul {
  list-style: none;
  padding: 0;
  margin: 20px 6px 0 0;
}

.colors li {
  padding-left: 24px;
  font-size: 14px;
  position: relative;
}

.colors li::after,
.colors li::before {
  content: '';
  position: absolute;
}

.colors li::before {
  width: 10px;
  height: 22px;
  left: 0;
  top: -10px;
}

.colors li::after {
  width: 8px;
  top: 11px;
  left: 10px;
  border-top: 1px lightgray solid;
}

.colors li:nth-child(1)::before {
  background-color: rgb(3, 22, 65);
}

.colors li:nth-child(2)::before {
  background-color: rgb(11, 49, 145);
}

.colors li:nth-child(3)::before {
  background-color: rgb(40, 84, 196);
}

.colors li:nth-child(4)::before {

}

.colors li:nth-child(5)::before {

}

.colors li:nth-child(6)::before {
  background-color: rgb(216, 224, 243);
}

.colors li:nth-child(7)::before {
  background-color: rgb(237, 237, 237);
}

.colors li:nth-child(8)::before {
  background-color: white;
  border: 1px solid lightgray;
}
